import React from "react";
import Calendar from 'react-calendar'
import './Page.css'
function Event()
{
    return(
        <div>
        <center>
        <h1>Its event page</h1>
        <div id='calendar'>
        <Calendar onClickDay={(e)=>{alert(e.getDay)}}/>
        </div>
        </center>
        <div></div>
        </div>
    )
}

export default Event;
